CREATE DEFINER=`root`@`localhost` FUNCTION `count_discount`(c int) RETURNS int(11)
BEGIN
  DECLARE discount int;
   if c>=1000 THEN
        set discount=0.12*c;
    end if;

    if c<1000 and c>=100 THEN
        set discount=0.08*c;
    end if;

    if c<100 THEN
        set discount=0;
     end if;


  return discount;
END ;;
