CREATE DEFINER=`root`@`localhost` PROCEDURE `apply_discount`()
begin 
  DECLARE done INT DEFAULT false;
  DECLARE a INT;
  DECLARE b INT;
  DECLARE c INT;
  DECLARE cnt int ;
  DECLARE cur CURSOR FOR SELECT track_id,order_id,original_price FROM orders;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = true;

  OPEN cur;

  loop1: LOOP
    FETCH cur INTO a,b,c;
    IF done THEN
      LEAVE loop1;
      
    END IF;
    if c>=1000 THEN
      update orders
        set discount=0.12*c
        where orders.track_id=a and orders.order_id=b;
    end if;

    if c<1000 and c>=100 THEN
      update orders
        set discount=0.08*c
        where orders.track_id=a and orders.order_id=b;
    end if;

    if c<100 THEN
      update orders
        set discount=0
        where orders.track_id=a and orders.order_id=b;
     end if;

   
  END LOOP;

end ;;
