CREATE DEFINER=`root`@`localhost` PROCEDURE `search_artist`(name varchar(100))
BEGIN

  select artist.first_name,track.track_id,track.name as track_name from 
  track,makes,artist 
  where 
  makes.artist_id=artist.artist_id 
  and 
  track.track_id=makes.track_id 
  and
   concat(artist.first_name," ",artist.last_name) like concat("%",name,"%") ;

END ;;
DELIMITER ;
